import { Link } from "react-router-dom";
function Header() {
  return (
    <div className="menu">
      <a href="/">
        <img src="https://youxgroup.com.br/wp-content/uploads/2021/07/logosite.png" />
      </a>

      <Link to="/">Home</Link>
    </div>
  );
}

export default Header;
